document.addEventListener("DOMContentLoaded",()=>{const e=document.querySelector(".profile-main").offsetHeight;document.querySelector(".profile-page").style.backgroundSize=e<800?"100vh":"",document.querySelectorAll(".profile-link").forEach(e=>{e.addEventListener("click",()=>{let t=e.dataset.id;fetch(`/api/social-links/${t}/click/`,{mode:"cors",method:"POST",headers:{Accept:"application/json, text/plain","Content-Type":"application/json;charset=UTF-8","X-CSRFToken":getCookie("csrftoken")},body:null}).then(e=>{if("ok"===e.status)return e.json()}).catch(e=>console.log(e))})})});